import StyleBase from '../components/StyleBase';
const Footer = () => {
    return (
        <styleBase>
            <section>
                <div className="socialIcons">
                    <img src={require('../public/social_icons/facebook.svg')} />
                    <img src={require('../public/social_icons/twitter.svg')} />
                    <img src={require('../public/social_icons/youtube.svg')} />
                </div>
            </section>
        <style jsx>{`
        section {
            height: 500px;
            // background: #f29a2f;
            background: url(https://images.pexels.com/photos/214045/pexels-photo-214045.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=750&w=1260);
        }
        .socialIcons {
            height: 50%;
        }
        .socialIcons img {
            width: 30%;
        }
        `}</style>
        </styleBase>
    )
}

export default Footer;
